import React from 'react';
import Navbar from "../components/Navbar";
import FetchMovies, {Movie} from "../components/FetchMovies";
import {Genre} from "../components/FetchGenres";

type Prop = {
    genre: Genre
}

const Home = ({genre}: Prop) => {
    return (
        <main>
            <Navbar />
            <h1>Home</h1>
            <FetchMovies genre={genre}/>
        </main>
    );
};

export default Home;
